import React from 'react'
import Theme from './Theme'

const theme=Theme();

export default function Sidebar() {
  return (
    <Box bgcolor={theme.palette.primary.main} sx={{height:"100%"}}>
      <h1>My side bar</h1>
    </Box>
  )
}
